[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#Modules","page":"API","title":"Modules","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Order = [:module]","category":"page"},{"location":"api/#Types-and-constants","page":"API","title":"Types and constants","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Order = [:type, :constant]","category":"page"},{"location":"api/#Functions-and-macros","page":"API","title":"Functions and macros","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Order = [:macro, :function]","category":"page"},{"location":"api/#Documentation","page":"API","title":"Documentation","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Modules = [OneTwoMany]\nOrder = [:module, :type, :constant, :macro, :function]","category":"page"},{"location":"api/#OneTwoMany.OneTwoMany","page":"API","title":"OneTwoMany.OneTwoMany","text":"OneTwoMany\n\nProvides provides utility functions for accessing the first, second and the rest of the elements of a collection.\n\n\n\n\n\n","category":"module"},{"location":"api/#OneTwoMany.first_and_rest","page":"API","title":"OneTwoMany.first_and_rest","text":"first_and_rest(x)\n\nReturns a tuple that contains the first and the rest of the elements of x.\n\nx may be an AbstractArray, Tuple, NamedTuple, Pair, AbstractString, or an iterable in general.\n\n\n\n\n\n","category":"function"},{"location":"api/#OneTwoMany.first_second_rest","page":"API","title":"OneTwoMany.first_second_rest","text":"first_second_rest(x)\n\nReturns a tuple that contains the first, second, and the rest of the elements of x.\n\nx may be an AbstractArray, Tuple, NamedTuple, Pair, AbstractString, or an iterable in general.\n\n\n\n\n\n","category":"function"},{"location":"api/#OneTwoMany.firstarg","page":"API","title":"OneTwoMany.firstarg","text":"firstarg(args...)\n\nReturns the first elements of args....\n\n\n\n\n\n","category":"function"},{"location":"api/#OneTwoMany.getsecond","page":"API","title":"OneTwoMany.getsecond","text":"getsecond(x)\n\nReturn the second element of x.\n\nx may be an AbstractArray, Tuple, NamedTuple, Pair, AbstractString, or an iterable in general. ```\n\n\n\n\n\n","category":"function"},{"location":"api/#OneTwoMany.secondarg","page":"API","title":"OneTwoMany.secondarg","text":"secondarg(args...)\n\nReturns the second elements of args....\n\n\n\n\n\n","category":"function"},{"location":"LICENSE/#LICENSE","page":"LICENSE","title":"LICENSE","text":"","category":"section"},{"location":"LICENSE/","page":"LICENSE","title":"LICENSE","text":"using Markdown\nMarkdown.parse_file(joinpath(@__DIR__, \"..\", \"..\", \"LICENSE.md\"))","category":"page"},{"location":"#OneTwoMany.jl","page":"Home","title":"OneTwoMany.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This package provides utility functions for accessing the second element, as well as the first, second and remaining elements, of iterable objects:","category":"page"},{"location":"","page":"Home","title":"Home","text":"A function getsecond(x): Julia provides the functions first and last, but not second (except for Dates.second, which is about seconds in time). last can be used to access the second element of a Tuple with two elements or a Pair, but getsecond is clearer semantically. With tuples, it is also safer in cases where the upstream code that generates the tuple might change and generate longer tuples in the future.\nTwo functions first_and_rest and first_second_rest to get both the first (two) element(s) and the rest of an iterable object.\nTwo functions firstarg and secondarg to get that simply return their first, resp. second, argument.","category":"page"}]
